import { openPopupWidget } from 'react-calendly';

export const ScheduleConsultation = ({ url, prefill, pageSettings, utm }) => {
         const onClick = () =>
           openPopupWidget({ url, prefill, pageSettings, utm });

         return <button onClick={onClick}>Custom Button</button>;
       };
